void LefTest::pushTestEvent()
{
  /* check array boundaries */

  if (data->counter >= ARRAYSIZE(s_values))
    return data->timer->stop();

  /* get test item */

  const TestItem &item  = s_values[data->counter++];

  /* construct fake event */

  QWheelEvent newEvent(
    item.pos,
    data->baseData.globalPosition,
    item.pixelDelta,
    item.angleDelta,
    data->baseData.buttons,
    data->baseData.modifiers,
    item.phase,
    item.inverted,
    item.source
  );
//  QWheelEvent newEvent(
//    item.pos,
//    data->baseData.globalPosition,
//    QPoint(),//item.pixelDelta,
//    item.pixelDelta,//item.angleDelta,
//    data->baseData.buttons,
//    data->baseData.modifiers,
//    item.phase,
//    item.inverted,
//    item.source
//  );

  /* send */

  QCoreApplication::sendEvent (data->target, &newEvent);
}

